import styled from 'styled-components'
import banner from './Portfolio_Banner.png';


class Home extends Component {
  render(){
  return (


   <div>
    <div>
      <h1>Home page/ about</h1>

    </div>
    <div>
    <BannerContainer className = "first-banner">

    <img src={banner} alt ="Banner" >
    </img>

    </BannerContainer>
    </div>
    </div>
  );
  }
}

export default Home;

const BannerContainer = styled.footer`

.first-banner{
  max-width: 80%;
  height: auto;
}

`
